import React ,{useState}from "react";

const [count, setCount] = useState(0);

function CountUp(){
    setCount(count + 1);
}

function CountDown(){
    setCount(count - 1);
}

export function GainCounter(){
    return (
        <button onClick={CountUp}>+1</button>
    );
}

export function DropCounter(){
    return (
        <button onClick={CountDown}>-1</button>
    );
}

export function CountNumber(){
    return (
        <>
        {count}
        </>
    )
}
